import styled from "styled-components";
import animation from "../animation.css";

function Home() {
  return (
    <Contain>
        <HeadingContain><h2>Hello, DHRUv Here!!</h2></HeadingContain>
        <TexTContain>Rise Again & Again, Never Give Up</TexTContain>
        
    </Contain>
  )
}

const Contain=styled.div`
    text-align: center;
    margin-top: 250px;
    margin-left: 35px;
    color:#f9f9f9;
`

